    def capacitor_current(self):
            x = np.linspace(1, 3, 301)
            plt.plot((self.v1value1()/self.resistorvalue1()*np.exp(-x/(self.resistorvalue1()*self.capacitorvalue()))))
            plt.xlabel("                                   t")
            plt.ylabel("Ic")
            plt.grid(True)
            plt.savefig('graph7.png')
            self.label_51.setPixmap(QtGui.QPixmap("graph7.png"))
            self.label.setScaledContents(True)
    def capacitor_voltage(self):
            x = np.linspace(1, 3, 301)
            plt.plot((self.v1value1()*(1-np.exp(-x/(self.resistorvalue1()*self.capacitorvalue())))))
            plt.xlabel("                                   t")
            plt.ylabel("Vc")
            plt.grid(True)
            plt.savefig('graph8.png')
            self.label_51.setPixmap(QtGui.QPixmap("graph8.png"))
            self.label.setScaledContents(True)



